        <TextBox> <h1 className='textbox_1'> Growing Beautiful Plants at Home</h1> <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Doloremque aspernatur, impedit nam rerum tempore optio quibusdam enim consequuntur excepturi, veritatis sunt consequatur commodi aut. Ut blanditiis quaerat neque commodi magni?</p> 
